function autocompleteCidade(event) {
  var input = event.target;
  var cidadeList = document.getElementById("cidade-list");
  var cidade = input.value.toLowerCase();

  if (cidade.length < 4) {
    cidadeList.innerHTML = "";
    return;
  }

  cidadeList.innerHTML = "";

  for (var estado in estados) {
    if (estados.hasOwnProperty(estado)) {
      var estadoData = estados[estado];
      var cidadesDoEstado = estadoData.cidades;

      for (var i = 0; i < cidadesDoEstado.length; i++) {
        var cidadeAtual = cidadesDoEstado[i].toLowerCase();

        if (cidadeAtual.startsWith(cidade)) {
          var cidadeItem = document.createElement("div");
          cidadeItem.textContent = cidadeAtual;
          cidadeItem.setAttribute("onclick", "selectCidade('" + cidadeAtual + "')");
          cidadeList.appendChild(cidadeItem);
        }
      }
    }
  }
}

function selectCidade(cidade) {
  document.getElementById("cidade").value = cidade;
  document.getElementById("cidade-list").innerHTML = "";
}



function sanitizeInput(event) {
  const inputField = event.target;
  let inputValue = inputField.value;

  inputValue = inputValue.normalize("NFD").replace(/[\u0300-\u036f]/g, "");

  inputValue = inputValue.toLowerCase();

  if (inputValue !== inputField.value) {
    inputField.value = inputValue;
  }
}

function formatarCEP(cepInputId) {
  var cepInput = document.getElementById(cepInputId);
  var cep = cepInput.value.replace(/\D/g, '');
  if (cep.length > 5) {
    cep = cep.substring(0, 5) + '-' + cep.substring(5, 8);
  }
  cepInput.value = cep;
}
